body_text:
增加以下特性：

表头支持列合并
单元格占多行
单元格占多列

API变动：
columns = [{
  title: '列一',
  dataindex: '',
  colSpan: 2, // 列头占两列
  render(value, record, index) {
    return {
      children: value,  // 单元格内容
      props: {
        align: 'right' // 向右对齐
        colSpan: 2, // 单元格占两列
        rowSpan: 2 // 单元格占两行
      }
    };
  }
}]
